import { useNavigate, useLocation } from 'react-router-dom';
import React, { useState , useEffect } from "react";
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import InboxIcon from '@mui/icons-material/Inbox';
import DraftsIcon from '@mui/icons-material/Drafts';
import { AddAdminButton } from './Atoms/add-admin-button';

export const logUser = (updatedUser) => {
  console.log(updatedUser);

}
export const AddAdmin = (currentUser, setCurrentUser) =>{
  const updatedUser = {
    ...currentUser,
    role: "admin"
  }
  return updatedUser
}


export const HomepageForm = () => {

    const location = useLocation();
    const { state } = location;
    const [currentUser, setCurrentUser] = useState(state);
  const navigate = useNavigate();

  // const [user, setUser] = useState({
  //   firstName: '',
  //   lastName: '',
  //   email: '',
  //   OrgID: '',
  //   UserID: '',
  //   valid: false
  // });
  const [newUser, setNewUser] = useState("");
  const [newFirst, setNewFirst] = useState("");
  const [newLast, setNewLast] = useState("");
  const [newEmail, setNewEmail] = useState("");
  const [userData, setUserData] = useState(null); // Define userData here

  useEffect(() => {
    if (state == null || currentUser == null) {
      console.log(currentUser);
      navigate('/login');
    }
  
  }, [state, currentUser]);

  const DirectToDelete = () => {
    navigate('/delete-account', { state: currentUser });
    console.log('this should take you somewhere')
  }
  const DirectToUpdate = () => {
    navigate('/update-account', { state: currentUser });
  }
  
  if (!currentUser) {
    return
  }


  const handleClick = () => {
    
    const updatedUser = AddAdmin(currentUser, setCurrentUser);
    logUser(updatedUser)
  };
//   const showUsers = async () => {
//     try {
//       const response = await axios.get(API_URL, {
//         params: {
//             OrgID: newUser,
//             firstName: newFirst,
//             lastName: newLast,
//             email: newEmail
//           }
//         });
//       console.log(response.data)
//       setUserData(response.data);
//     } catch (err) {
//       console.log(`you failed to retrieve information this is the error ${err}`);
//     }
//   };
  if (state) {
    return (
      <div className='container'>
        <div className='side-rectangle'>
          
          <div className="logo-container">
            <img src="logo-white.png" alt="WebWiz Logo" className="logo"/>
            <span className="logo-text-white">WEBWIZ</span>
         
          </div>
         <div className='list-box'>
         <List sx={{ width:'%100' }}>
          <ListItem sx={{ width:'%100' }} disablePadding>
            <ListItemButton sx={{ width:'%100' }} onClick={() => setCurrentUser(null)}>
              <ListItemIcon>
                <InboxIcon />
              </ListItemIcon>
              <ListItemText primary="Log Out" />
            </ListItemButton>
          </ListItem >
          <ListItem sx={{ width:'%100' }} disablePadding>
            <ListItemButton onClick={() => DirectToUpdate()}>
              <ListItemIcon>
                <DraftsIcon />
              </ListItemIcon>
              <ListItemText primary="Edit Profile" />
            </ListItemButton>
          </ListItem>
          <AddAdminButton onClick={handleClick}/> {/*  THIS IS THE ADD ADMIN BUTTON UNCOMMENT TO SHOW*/} 
        </List>
        </div>
        <div className='list-box-delete'>
         <List sx={{ width:'%100' }}>
          <ListItem sx={{ width:'%100' }} disablePadding>
            <ListItemButton sx={{ width:'%100' }} onClick={() => DirectToDelete()}>
              <ListItemIcon>
                <InboxIcon />
              </ListItemIcon>
              <ListItemText primary="Delete Profile" />
            </ListItemButton>
          </ListItem >
        </List>
        </div>
        </div>
        <div className='big-rectangle'>
          <h1 className='title'>Welcome, {currentUser ? currentUser.firstName + " " + currentUser.lastName : ""}!</h1>
          <h3>
          UserID Key: {currentUser.UserID}
          </h3>
          <h3>
            OrganizationID Key: {currentUser.OrgID}
          </h3>
          <h3>
            Company Email: {currentUser.email}
          </h3>

          
        </div>
        
      </div>
    )
  } else {    
    return (
      <div>
        <body>
          ERROR DISPLAYING USER INFO
        </body>
      </div>
    )
      
    
}

}
